                "Name": "孤韻",
                "Desc": "「戦意の洶湧」フェーズの間、味方が戦闘スキルを発動して攻撃を行った後、攻撃したターゲットに追加で本来のダメージ<color style='color:#f29e38;'> 30% </color>分の確定ダメージを与える。",
