                "Desc": "「戦意の洶湧」フェーズの間、味方による持続ダメージはターゲットの全属性耐性を<color style='color:#f29e38;'> 20% </color>無視する。敵が持続ダメージを受けた後、味方それぞれによる持続ダメージ+<color style='color:#f29e38;'> 1% </color>、最大で<color style='color:#f29e38;'> 99 </color>層累積できる、「戦意の洶湧」フェーズ終了まで継続。",
